#include "Interfaces.h"
#include "ShonaxOffsets.h"


namespace UTILS
{
	Vector TraceToEnd(Vector start, Vector end)
	{
		trace_t trace;
		CTraceWorldOnly filter;
		Ray_t ray;
		
		ray.Init(start, end);
		m_pTrace->TraceRay(ray, MASK_ALL, &filter, &trace);
		
		return trace.endpos;
	}
	const char* GetHitgroupName(int hitgroup)
	{
		switch (hitgroup)
		{
		case 1:
			return "Head";
		case 2:
			return "Chest";
		case 3:
			return "Pelvis";
		case 4:
			return "Left Arm";
		case 5:
			return "Right Arm";
		case 6:
			return "Left Leg";
		case 7:
			return "Right Leg";
		default:
			return "";
		}
	}
	float GetCurtime()
	{
		if (!m_pEngine->IsConnected())
			return 0.f;

		if (!m_pEngine->IsInGame())
			return 0.f;
		
		auto local_player = m_pEntityList->GetClientEntity(m_pEngine->GetLocalPlayer());

		if (!local_player)
			return 0.f;

		return local_player->GetTickBase() * m_pGlobals->interval_per_tick;
	}

}

